from collections import Counter
from typing import List


class Solution:
    def validPartition(self, nums: List[int]) -> bool:
        nums.sort()
        visited = [True for _ in nums]
        length = len(nums)
        origin_counter = Counter(nums)
        two_set = {k for k in origin_counter.keys() if origin_counter[k] == 2}
        for i in range(length-2):
            n = nums[i]
            if not visited[i]:
                continue
            if n not in two_set and nums[i:i+3] == [n, n+1, n+2]:
                visited[i] = False
                visited[i+1] = False
                visited[i+2] = False
        filter_nums1 = [nums[i] for i in range(length) if visited[i]]
        counter1 = Counter(filter_nums1)
        reversed_nums = sorted(nums, reverse=True)
        visited2 = [True for _ in nums]
        for i in range(length-2):
            n = reversed_nums[i]
            if not visited2[i]:
                continue
            if n not in two_set and reversed_nums[i:i+3] == [n, n-1, n-2]:
                visited2[i] = False
                visited2[i+1] = False
                visited2[i+2] = False
        filter_nums2 = [reversed_nums[i] for i in range(length) if visited2[i]]
        counter2 = Counter(filter_nums2)
        ans1 = True
        ans2 = True
        for k, v in counter1.items():
            if counter1[k] < 2:
                ans1 = False
        for k, v in counter2.items():
            if counter2[k] < 2:
                ans2 = False
        if ans1:
            return True
        if ans2:
            return True
        return False


